import React from 'react';

function CV() {
  return (
    <div>
      <header>
        <h1>Linus Aspelof</h1>
        <nav>
          <ul>
            <li><a href="/">Hem</a></li>
            <li><a href="/about">Om Mig</a></li>
            <li className="active"><a href="/cv">CV</a></li>
            <li><a href="/portfolio">Portfolio</a></li>
            <li><a href="/kontakt">Kontakt</a></li>
          </ul>
        </nav>
      </header>

      <main id="cv-container">
        {/* Your CV content goes here */}
      </main>

      <footer>
        <p>&copy; 2024 Linus Aspelöf. All rights reserved.</p>
        {/* You may include any JavaScript files here */}
      </footer>
    </div>
  );
}

export default CV;
